About ceriale:
 Olivia Dunham - a young FBI agent is forced to work with staff scientists to 
investigate unexplained phenomena. Among the employees of this department of the 
secret National Security - Dr. Walter Bishop - something in between Einstein and 
Frankenstein, his son with an IQ of 200, has not graduated from school with 
gambling debts and Nina Sharp, who has worked on a secret organization for 16 years.
 A special agent Phillip Broyles heads the National Library Department, designed to 
investigate the paranormal.

Did you know that ...
- In the credits of various series &quot;Facets&quot; you can see hidden characters in frames, 
  so-called &quot;glyphs.&quot; The characters have a &quot;yellow spot&quot;, symbolizing the special 
  together Glifichesky alphabet. At the end of each series can make the letters    keyword.
- In the tenth series of the third season has a link to the TV series &quot;Twin Peaks&quot;.
  Professor Walter Bishop for a hypnosis session wearing stereo glasses, one lens 
  red and the other - the blue. According to him, these glasses can help           to see the human aura, and his friend invented them - Dr. Jacoby. Similar wore glasses psychiatrist Dr. Jacoby in the TV series &quot;Twin Peaks&quot;.


